body:
Ich bin Finn, 15 Jahre alt, und Main Jungler. Bin auf der Suche nach 1-2 DynamicQueue Mates die auf &auml;hnlicher Elo sind und Spa&szlig; am Spiel haben, sich aber auch verbessern wollen. Vorzugsweise Top/Mid-Mains, aber andere Positionen sind auch nicht unerw&uuml;nscht. Wer Interesse hat: Skype finnzoggtyt und inGame FinnZoggt.
Ich m&ouml;chte wirklich regelm&auml;&szlig;ig spielen, genauere Termine werden bei Kontaktaufnahme vereinbart :) meinen Zeitplan und mein LoL-Profil seht ihr oben. In den Zeitplan k&ouml;nnt ihr euch auch selbst eintragen {{item:2043}} 
Freue mich darauf, mit euch zu climben{{summoner:11}} 






